  \"benton-lake-national-wildlife-refuge-narrative-report-january-to-december-1971\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Benton
  Lake outlines Refuge accomplishments during the 1971 calendar year.  The report
  begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, predators, rodents, mammals, and raptors, reptiles,
  disease- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, and prescribed burning.
  Resource management is outlined; topics include grazing and fur harvest. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, hunting and safety. Items of interest, N-R forms are attached.\",\n\t\"license_title\":
